import { useState } from "react";
import logo from "../src/data/Humaaans - Plant 1.png";
export default function App() {
  return (
    <>
      <Nav />
      <Section />
      <Footer />
    </>
  );
}

function Nav() {
  return (
    <nav>
      <Datenow />
      <Todo />
      <ImgLogo />
    </nav>
  );
}
function Datenow() {
  const currentDate = new Date().toDateString();
  return (
    <div className="first-nav nav">
      <h4> {currentDate}</h4>
      <p className="xxx">X active Tasks</p>
    </div>
  );
}
function Todo() {
  return (
    <div className="first-nav nav">
      <h1 className="todo">To do List</h1>
    </div>
  );
}
function ImgLogo() {
  return (
    <div className="first-nav nav">
      <img src={logo} alt="logo" height={70} />
    </div>
  );
}

function Section() {
  const [message, setmessage] = useState("");
  const [display, setDisplay] = useState("");
  const [remove, setremove] = useState("");

  function handleremove() {
    setDisplay("1233");
  }

  function handlemessage(e) {
    setmessage(e.target.value);
    // console.log(e.target.value);
  }
  function handledisplay() {
    setDisplay(message);
    console.log(message);
  }

  return (
    <section>
      <Inputbar
        message={message}
        handlemessage={handlemessage}
        handledisplay={handledisplay}
      />
      <Card message={message} display={display} />
    </section>
  );
}
function Inputbar({ handlemessage, handledisplay, display }) {
  return (
    <div className="input-ctn">
      <input placeholder="add your to do" onChange={handlemessage} />
      <div className="Add-ctn">
        <button onClick={handledisplay}>Add</button>
      </div>
    </div>
  );
}
function Card({ message, display }) {
  return (
    <div className="data">
      <Cardone display={display} />
      <Longbar />
      <Cardtwo message={message} />
      <Longbar />
      <Cardthree message={message} />
      <Longbar />
      <Cardfour message={message} />
      <Longbar />
      <Cardfive message={message} />
    </div>
  );
}

function Cardone({ message, display }) {
  return (
    <div className="bar1">
      <p> {display}</p>
      <Theicons />
    </div>
  );
}

function Cardtwo() {
  return (
    <div className="bar1">
      <p>Deploy App and then get into meeting with team </p>
      <Theicons />
    </div>
  );
}

function Cardthree() {
  return (
    <div className="bar1">
      <p>Go pick up pizza tonight</p>
      <Theicons />
    </div>
  );
}

function Cardfour() {
  return (
    <div className="bar1">
      <p>Going to soho house with my friends</p>
      <Theicons />
    </div>
  );
}

function Cardfive() {
  return (
    <div className="bar1">
      <p>Get prepare for an marathon</p>
      <Theicons />
    </div>
  );
}

function Theicons() {
  return (
    <div className="bar-icons">
      <i class="fa-solid fa-trash"></i>
      <i class="fa-solid fa-pen-to-square"></i>
    </div>
  );
}

function Longbar() {
  return <div className="long-bar"></div>;
}

function Footer() {
  return <Footerdata />;
}

function Footerdata() {
  return (
    <footer>
      <p>
        Made with <i class="fa-solid fa-heart" style={{ color: "red" }}></i>
      </p>
      <a href="https://github.com/fensley">
        <i classame="fa-brands fa-github"></i>
      </a>
    </footer>
  );
}
